import React from 'react'
import logo from "../assets/images/Logo-2.png"
import { Link } from "react-router-dom"

const mainNav = [
    {
        display: 'Trang chu',
        path: "/"
    },
    {
        display: 'San pham',
        path: "/catalog"
    },
    {
        display: "Phu kien",
        path: "/accessories"
    },
    {
        display: 'Lien he',
        path: "/contact"
    }
]


const Header = () => {
    return (
        <div className="header">
            <div className="container">
                <div className="header__logo">
                    <Link>
                        <img src={logo} alt="" />
                    </Link>
                </div>
            </div>
        </div>
    )
}

export default Header
